import React from "react";
import {useState,useEffect} from 'react';

function Catalog(props){
    console.log(props);
    const [data, setData] = useState({});
    let result =[];
    useEffect(()=>{
    fetch("/catalog").then(
        res=>res.json())
        .then(data=>setData(data));
    for(let i in data)
    result.push(data[i].name);

    },[]);
    console.log(data);
    console.log(result);
    return(
        <div>
            {result}
        </div>
    );
}
export default Catalog;
